import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';

const PageOne = () => {
    return (
        <div>
            <form>
                Name: <input type='text'></input>
            </form>
            <p>Page 1</p>
        </div>
    );
}

const PageTwo = () => {
    return (
        <div>
            <button>Enter</button>
            <p>Page 2</p>
        </div>
    );
}

const App = () => {
    return (
        <div>
            <BrowserRouter>
            <div>
                <Route path='/' exact component={PageOne}/>
                <Route path='/pageTwo' component={PageTwo}/>
            </div>
            </BrowserRouter>
        </div>
    );
};

export default App;
